    var obsTimeStr = context.weatherSummary.observation.obsTime
    var obsDate = new Date(obsTimeStr.substring(0,4), parseInt(obsTimeStr.substring(5,7), 10) - 1, obsTimeStr.substring(8,10), 0, 0, 0, 0)

    return  obsDate.getMonth() + 1 >= 6 && 
            obsDate.getMonth() + 1 < 8 &&
            context.device.localeCountryCode == "US" &&
            (context.device.localeLanguage == "en" || context.device.localeLanguage == "es")
}

