function isTStormNowInDayPart(daypart){

    var thunderEnumCodes = [3, 4, 5];
    return daypart.dayPartTitle !== null && thunderEnumCodes.indexOf(daypart.thunderEnum) != -1;
}

function isTStormSoonInDayPart(daypart){

    var thunderEnumCodes = [4, 5];
    return daypart.dayPartTitle !== null && thunderEnumCodes.indexOf(daypart.thunderEnum) != -1;
}

function isSevereTStormImpactedNow(){

    if (isTStormNowInDayPart(context.weatherSummary.dayForecast.day)){
        return true;
    } else if (isTStormNowInDayPart(context.weatherSummary.dayForecast.night)){
        return true;    
    } else if (context.weatherSummary.dayForecast.day.dayPartTitle == null && isTStormNowInDayPart(context.weatherSummary.tomorrowForecast.day)){
        return true;
    }
    return false;
}

function isSevereTStormImpactSoon(){

    if(context.turbo.vt1dailyforecast.night.dayPartName !== null && context.turbo.vt1dailyforecast.night.dayPartName.length>0){
        context.weatherSummary.tomorrowForecast.night.dayPartTitle = context.turbo.vt1dailyforecast.night.dayPartName[1]; 
    }
    if(context.turbo.vt1dailyforecast.day.dayPartName !== null && context.turbo.vt1dailyforecast.day.dayPartName.length>0){
        context.weatherSummary.tomorrowForecast.day.dayPartTitle = context.turbo.vt1dailyforecast.day.dayPartName[1]; 
    }    

    return (!isSevereTStormImpactedNow() && 
            (isTStormSoonInDayPart(context.weatherSummary.tomorrowForecast.day) || 
            isTStormSoonInDayPart(context.weatherSummary.tomorrowForecast.night)));
}

isSevereTStormImpactSoon();

